import React from 'react';
import { NavLink } from 'react-router-dom';
import Comon from './comon';
import web from "../src/svg/web.svg"

const Home=()=> {
  return (
    
      <>
      <Comon title={`Grow your business with`}
      des={ `We have some good developer to making website`}
      button={`Get Started`}
      img={web}/>
      <section id="header" className="d-flex align-items-center">
                <div className="container-fluid mb-auto">
          <div className="row">
              <div className="col-10 mx-auto  d-flex">
                  <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                      <h1>Grow your business with <strong className="brand-name">Jaskirat Singh</strong></h1>
                      <h2 className="my-3"> We have some good developer to making website</h2>
                     <div className="mt-3">
                         
                         
                    <NavLink to="/service"  className="btn-get-started">Get Started</NavLink> </div>
                  </div>
                  <div className="col-lg-6 order-1 order-lg-2 header_img">
                      <img className="img-fluid animated" src={web} alt="textimage"/>
                  </div>

              </div>
          </div>
      </div>
       
      </section>

    </>
  );
}

export default Home;
